import React from 'react'

import '../../features/linkItem/linkItemStyle.css'

const LinkItem = (props) => {
  return (
    <div className='linkItem'>
        <input className='linkItemLabel' value='link goes here'></input>        
        <button className='linkItemGotoLinkBtn'></button> {/* when clicked another tab of the link opens */}
        <button className='linkItemFavBtn'></button>
        <button className='linkItemBinBtn'></button>        
    </div>
  )
}

export default LinkItem
